import React from 'react'
import ThermostatTwoToneIcon from '@mui/icons-material/ThermostatTwoTone';
import Paper from '@mui/material/Paper';

const WeatherCard = () => {
  return (
    <>
        <div className='card__div'>

        <Paper sx={{
            width : "25%" ,
            height : "60vh" ,
            borderRadius : "5px" , 
            padding : "20px" , 
            backgroundColor : "#A0B7DC"
            }} elevation={12} > 
            

            <div className='card__items'>
                <input type="text"></input>
                <h1><ThermostatTwoToneIcon sx={{fontSize : "70px" , color : "white"}}/>London</h1>
                <h2>57.5°C</h2>
                <h5>Min : 57.5°C | Max : 57.5°C</h5>
            </div>
            
        </Paper>            

        </div>
    </>
  )
}

export default WeatherCard
